import React from 'react';
import { Link } from 'react-router-dom';
import './grids.css'
import die1 from '../assets/dice_1.svg';
import die2 from '../assets/dice_2.svg';
import die3 from '../assets/dice_3.svg';
import die4 from '../assets/dice_4.svg';



function Nav() {
  return (
    <div>
        <div className="navLink">
          <Link className="buttonLink" to='/mechanics'>Mechanics</Link>
        </div>
        <div className="navLink">
          <Link className="buttonLink" to='/playtest'>Playtest</Link>
        </div>
        <div className="navLink">
          <Link className="buttonLink" to='/examples'>Examples</Link>
        </div>
      </div>
  );
}


export default Nav;
